DROP DATABASE  sistema_alquileres;
CREATE DATABASE sistema_alquileres;

USE sistema_alquileres;
-- Tabla de roles de usuario
CREATE TABLE roles (
    id INT PRIMARY KEY AUTO_INCREMENT,
    nombre VARCHAR(100) NOT NULL
);

-- Tabla de usuarios del sistema
CREATE TABLE usuarios (
    id INT PRIMARY KEY AUTO_INCREMENT,
    nombre VARCHAR(100) NOT NULL,
    correo VARCHAR(100) UNIQUE NOT NULL,
    password VARCHAR(100) NOT NULL, -- Aquí se recomienda usar hashes como bcrypt
    rol_id INT,
    activo BOOLEAN DEFAULT TRUE,
    FOREIGN KEY (rol_id) REFERENCES roles(id) ON DELETE SET NULL
);

CREATE TABLE clientes (
    id INT AUTO_INCREMENT PRIMARY KEY,
    nombre VARCHAR(100) NOT NULL,
    nit VARCHAR(100),
    contacto VARCHAR(100),
    documento VARCHAR(50),
    telefono VARCHAR(20),
    correo VARCHAR(100),
    direccion TEXT
);


-- Tabla: Proveedores 
CREATE TABLE proveedores (
    id INT AUTO_INCREMENT PRIMARY KEY,
    nombre VARCHAR(100) NOT NULL,
    contacto VARCHAR(100),
    telefono VARCHAR(20),
    correo VARCHAR(100),
    direccion TEXT
);




-- Tabla: Equipos 
CREATE TABLE equipos (
    id INT AUTO_INCREMENT PRIMARY KEY,
    serial VARCHAR(100) UNIQUE,
    placa_interna VARCHAR(50),
    tipo VARCHAR(50),
    caracteristicas TEXT,
    estado VARCHAR(50),
    modalidad_adquisicion VARCHAR(50),
    costo_adquisicion DECIMAL(12,2),
    proveedor_id INT NULL,
    FOREIGN KEY (proveedor_id) REFERENCES proveedores(id) ON DELETE SET NULL
);






-- Tabla: Alquileres
CREATE TABLE alquileres (
    id INT AUTO_INCREMENT PRIMARY KEY,
    equipo_id INT,
    cliente_id INT,
    orden_cliente VARCHAR(100),
    referencia_odoo VARCHAR(100),
    fecha_entrega DATE,
    fecha_devolucion DATE,
    dias_alquiler INT,
    valor DECIMAL(12,2),
    valor_a_cobrar decimal(12,2),
    localizacion VARCHAR(100),
    usuario VARCHAR(100),
    proyecto VARCHAR(100),
    orden_odoo VARCHAR(100),
    administrativo VARCHAR(100),
    estado Boolean,
    remision_proveedor VARCHAR(100),
    numero_renovaciones INT,
    FOREIGN KEY (equipo_id) REFERENCES equipos(id) ON DELETE SET NULL,
    FOREIGN KEY (cliente_id) REFERENCES clientes(id) ON DELETE SET NULL
);








